import React from 'react'
import CenterView from 'react-bootstrap/Container'


const styles = {
    center: {
      marginLeft: "auto",
      marginRight: "auto"
    }
  }

class Home extends React.Component{
    render(){
        return (
            <CenterView className={styles.center}>
                <div name="Bio">
                    <h1>This is a bio!</h1>
                </div>
            </CenterView>
        )
    }
}

export default Home
